<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Puzzle for Akshara ‚ù§Ô∏è</title>
    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        body {
            background-color: #000;
            font-family: Arial, sans-serif;
            color: white;
            padding: 20px;
            overflow-x: hidden;
        }

        .container {
            max-width: 1200px;
            margin: 0 auto;
        }

        h1 {
            text-align: center;
            margin-bottom: 20px;
            font-size: 28px;
        }

        .puzzle-board {
            width: 600px;
            height: 600px;
            margin: 0 auto 30px;
            border: 3px solid #fff;
            position: relative;
            background-color: #111;
        }

        .pieces-container {
            display: grid;
            grid-template-columns: repeat(10, 1fr);
            gap: 10px;
            max-width: 1000px;
            margin: 0 auto;
            padding: 20px;
        }

        .puzzle-piece {
            width: 80px;
            height: 80px;
            cursor: grab;
            position: relative;
            background-size: 600px 600px;
            filter: drop-shadow(2px 2px 4px rgba(0, 0, 0, 0.5));
        }
        
        .puzzle-piece::before {
            content: '';
            position: absolute;
            top: 0;
            left: 0;
            right: 0;
            bottom: 0;
            background: inherit;
            background-size: inherit;
            background-position: inherit;
            clip-path: var(--piece-shape);
        }

        .puzzle-piece:active {
            cursor: grabbing;
        }

        .puzzle-piece.placed {
            opacity: 0.3;
            cursor: not-allowed;
        }

        .drop-zone {
            position: absolute;
            width: 75px;
            height: 75px;
            border: 2px dashed rgba(255, 255, 255, 0.3);
        }

        .drop-zone.filled {
            border: none;
        }

        .placed-piece {
            width: 75px;
            height: 75px;
            position: absolute;
            background-size: 600px 600px;
            filter: drop-shadow(1px 1px 2px rgba(0, 0, 0, 0.3));
        }
        
        .placed-piece::before {
            content: '';
            position: absolute;
            top: 0;
            left: 0;
            right: 0;
            bottom: 0;
            background: inherit;
            background-size: inherit;
            background-position: inherit;
            clip-path: var(--piece-shape);
        }

        .progress {
            text-align: center;
            font-size: 20px;
            margin-bottom: 20px;
        }

        .success-message {
            display: none;
            text-align: center;
            font-size: 24px;
            margin-top: 20px;
            color: #4CAF50;
        }
    </style>
</head>

        <h1>üíù Solve the Puzzle to Continue üíù</h1>

                // Corner pieces
                "polygon(0% 0%, 100% 0%, 100% 55%, 115% 60%, 115% 65%, 100% 70%, 100% 100%, 0% 100%, 0% 0%)"
            ];
            
            for (let i = 0; i < totalPieces; i++) {
                pieceShapes.push(shapes[Math.floor(Math.random() * shapes.length)]);

        // Initialize puzzle automatically when page loads
        window.addEventListener('load', function() {
            // Check if image is set
            if (uploadedImage && uploadedImage !== 'YOUR_IMAGE_URL_HERE') {
                initializePuzzle();
            } else {
                alert('Please add your image to the code! See the comment in the JavaScript section.');
            }
        });

        function initializePuzzle() {
            const board = document.getElementById('puzzleBoard');
            const container = document.getElementById('piecesContainer');
            
            board.innerHTML = '';
            container.innerHTML = '';
            placedPieces = 0;
            updateProgress();

            // Create 64 drop zones (8x8 grid)
            const rows = 8;
            const cols = 8;
            const zoneWidth = 75;
            const zoneHeight = 75;

            for (let i = 0; i < totalPieces; i++) {
                const row = Math.floor(i / cols);
                const col = i % cols;
                
                const dropZone = document.createElement('div');
                dropZone.className = 'drop-zone';
                dropZone.dataset.position = i;
                dropZone.style.left = (col * zoneWidth) + 'px';
                dropZone.style.top = (row * zoneHeight) + 'px';
                
                dropZone.addEventListener('dragover', handleDragOver);
                dropZone.addEventListener('drop', handleDrop);
                
                board.appendChild(dropZone);
            }

            // Create shuffled pieces
            const pieces = Array.from({length: totalPieces}, (_, i) => i);
            shuffleArray(pieces);

            pieces.forEach((position, index) => {
                const row = Math.floor(position / cols);
                const col = position % cols;
                
                const piece = document.createElement('div');
                piece.className = 'puzzle-piece';
                piece.draggable = true;
                piece.dataset.position = position;
                piece.style.backgroundImage = `url(${uploadedImage})`;
                piece.style.backgroundPosition = `-${col * 75}px -${row * 75}px`;
                piece.style.setProperty('--piece-shape', pieceShapes[position]);
                
                piece.addEventListener('dragstart', handleDragStart);
                
                container.appendChild(piece);
            });
        }

        function shuffleArray(array) {
            for (let i = array.length - 1; i > 0; i--) {
                const j = Math.floor(Math.random() * (i + 1));
                [array[i], array[j]] = [array[j], array[i]];
            }
        }

        let draggedPiece = null;

        function handleDragStart(e) {
            if (this.classList.contains('placed')) {
                e.preventDefault();
                return;
            }
            draggedPiece = this;
            e.dataTransfer.effectAllowed = 'move';
        }

        function handleDragOver(e) {
            if (e.preventDefault) {
                e.preventDefault();
            }
            e.dataTransfer.dropEffect = 'move';
            return false;
        }

        function handleDrop(e) {
            if (e.stopPropagation) {
                e.stopPropagation();
            }

            if (draggedPiece && !this.classList.contains('filled')) {
                const piecePosition = draggedPiece.dataset.position;
                const dropPosition = this.dataset.position;

                if (piecePosition === dropPosition) {
                    // Correct placement
                    const row = Math.floor(dropPosition / 8);
                    const col = dropPosition % 8;

                    const placedPiece = document.createElement('div');
                    placedPiece.className = 'placed-piece';
                    placedPiece.style.backgroundImage = `url(${uploadedImage})`;
                    placedPiece.style.backgroundPosition = `-${col * 75}px -${row * 75}px`;
                    placedPiece.style.left = this.style.left;
                    placedPiece.style.top = this.style.top;
                    placedPiece.style.setProperty('--piece-shape', pieceShapes[dropPosition]);

                    document.getElementById('puzzleBoard').appendChild(placedPiece);
                    
                    this.classList.add('filled');
                    draggedPiece.classList.add('placed');
                    
                    placedPieces++;
                    updateProgress();

                    if (placedPieces === totalPieces) {
                        puzzleComplete();
                    }
                }
            }

            return false;
        }

        function updateProgress() {
            document.getElementById('progressText').textContent = `Pieces: ${placedPieces}/64`;
        }

        function puzzleComplete() {
            document.getElementById('successMessage').style.display = 'block';
            setTimeout(() => {
                window.location.href = 'wordle.html';
            }, 2000);
        }
            // Skip functionality
        document.addEventListener('keydown', (e) => {
            if (e.ctrlKey && e.key === 'y') {
                window.location.href = 'wordle.html';
            }
        });
    </script>
